{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/shaikmohd/bellabeat-product-data-analysis?scriptVersionId=110687585\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"7a1c2154","metadata":{"papermill":{"duration":0.015768,"end_time":"2022-11-11T10:07:10.737102","exception":false,"start_time":"2022-11-11T10:07:10.721334","status":"completed"},"tags":[]},"source":["## Company Overview\n","\n","Bellabeat is a high-tech manufacturer of health-focused smart products specialized for women. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market.\n","\n","## Products\n","Bellabeat has several wellness-tracker products.\n","\n","* **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","* **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","* **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","* **Ivy**: A wellness-tracker designed as an elegant bracelet that monitors users heart rate, respiratory rate, and physical and mental activity. The data is combined and displayed as wellness score and readiness score to keep track on daily habit.\n","* **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","## Current Marketing Efforts \n","By 2016, Bellabeat had opened offices around the world and launched multiple products. Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website. The company has been making several marketing efforts, listed as follows.\n","\n","* Investing in traditional advertising media, such as radio, out-of-home billboards, print, and television\n","* Investing year-round in Google Search\n","* Maintaining active Facebook and Instagram pages\n","* Engaging consumers consistently on Twitter\n","* Running video ads on Youtube\n","* Displaying ads on the Google Display Network\n","\n","## Business Task \n","The Cofounder and Chief Creative Officer of Bellabeat believe that analyzing smart device fitness data could help unlock new growth opportunities for the company. The stakeholders are interested in insights into how consumers are using their smart devices based on their tracked activity data. The discoveries will then help guide marketing strategy to focus on one of the Bellabeat products. To summarize, the business task would be:\n","\n","What are the trends in fitness data of non-Bellabeat smart device users? How those insights can be applied to marketing strategies for one of the Bellabeat products?\n","\n","The data analysis will focus on the following tasks:\n","\n","1. Identifying users' habit in tracking daily activities and recording sleep.\n","2. Determining metrics to identify users activity level; intensity value vs total steps.\n","3. Identifying trends in users' activity levels.\n","4. Identifying trends of hourly activity across different user types.\n","5. Identifying trends of daily activity on days of the week across different user types.\n","\n","## Data Overview \n","## Data Source \n","The dataset provided by this case study is [FitBit Fitness Tracker Data](http://www.kaggle.com/datasets/arashnic/fitbit). Data is made available by Möbius on Kaggle. This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 2016-12-03 and 2016-12-05. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors and preferences.\n","\n","## License and Accessibility \n","This dataset is listed as [CC0: Public Domain](http://creativecommons.org/publicdomain/zero/1.0/), which means that people get the free access, usage, and sharing of the data to perform their work, even for commercial purposes, all without asking permission.\n","\n","## Data Organization \n","The dataset contains eighteen tables. Some of them are in the long format of their alternate version (wide format), and some are the merged version of several tables. For several metrics, like number of steps and active minutes, the dataset provides daily, hourly, and minute-level of data.\n","\n","## Data Credibility \n","Data credibility determines whether a data source is a good or a bad data source. A good data source must be reliable, original, comprehensive, current, and cited. Metadata (data about the data) usually provide this level of information. Credibility issues can be solved strictly by collecting additional data, completing missing variables, and gathering data from different sources.\n","\n","## Data Integrity Verification \n","Data integrity deals with the accuracy, completeness, consistency, and trustworthiness of data. A dataset is unsatisfactory if it is dirty, not aligned to business objectives, insufficient, and contains errors. To check for the integrity, analysts most likely have to use tools or functions such as sort and filter.\n","\n","## Data Cleaning \n","From this section onward, the data is processed using R in RStudio. R is an exceptional tool for data exploration, cleaning, analysis, and visualization because it has a variety of functions in packages to perform tasks. It can handle a large amount of data, record every data manipulation step in the script, and compile the results in a document (like this one) conveniently.\n","\n","## Loading Packages \n","The following packages contain useful functions to produce insightful trends out of the data.\n","\n","* tidyverse: an opinionated collection of R packages designed for data science. All packages share an underlying design philosophy, grammar, and data structures. It loads multiple packages at once, with ggplot2, dplyr, and tibble as some of the most popular ones.\n","* lubridate: makes it easier to work with dates and times.\n","* skimr: provides summary statistics about variables in data frames, tibbles, data tables and vectors.\n","* janitor: has simple functions for examining and cleaning dirty data."]},{"cell_type":"code","execution_count":1,"id":"6e995bb2","metadata":{"execution":{"iopub.execute_input":"2022-11-11T10:07:10.76861Z","iopub.status.busy":"2022-11-11T10:07:10.766602Z","iopub.status.idle":"2022-11-11T10:07:12.366342Z","shell.execute_reply":"2022-11-11T10:07:12.362866Z"},"papermill":{"duration":1.620912,"end_time":"2022-11-11T10:07:12.372048","exception":false,"start_time":"2022-11-11T10:07:10.751136","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[