 steps they would hope to reach on a daily basis. If the products determine that they are not on track to reach their goal, an alert could be sent to the users. The goal-setting program could also be used to set goals for calories to burn, activity levels (very active, fairly active, etc.), or water intake with their Spring water bottle product."]},{"cell_type":"markdown","id":"1b51377b","metadata":{"papermill":{"duration":0.022696,"end_time":"2022-11-11T10:07:16.525776","exception":false,"start_time":"2022-11-11T10:07:16.50308","status":"completed"},"tags":[]},"source":["What is the relationship between minutes asleep and time in bed?"]},{"cell_type":"code","execution_count":28,"id":"b7dfdafc","metadata":{"execution":{"iopub.execute_input":"2022-11-11T10:07:16.576292Z","iopub.status.busy":"2022-11-11T10:07:16.574583Z","iopub.status.idle":"2022-11-11T10:07:16.830064Z","shell.execute_reply":"2022-11-11T10:07:16.828291Z"},"papermill":{"duration":0.282965,"end_time":"2022-11-11T10:07:16.832287","exception":false,"start_time":"2022-11-11T10:07:16.549322","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUdf7H8c/MbMmW9IAC0jvST5qHhQN7AVQsJyJ4ov4Q24mIYkePExEVjrNx\ndj1Oz4IFKwKeHVAsdES61PSybWZ+f2wMIdlNNiHJbiav5x88ktnZ2c8Mm+w73/kWxTRNAQAA\nQOOnxrsAAAAA1A2CHQAAgEUQ7AAAACyCYAcAAGARBDsAAACLINgBAABYBMEOAADAIgh2AAAA\nFmHlYPftTb2UGJz7w/4GKObHBwcoijJ80dZoO2RvuDRcT0bXv0U9iuHr5nGEd1ua5w9vW3Vb\nX0VRzli+u65LjifTKOridiiKomqOlYXBWhyh2gtuVTV628f9zVNXBRTseKDyOaqaM6N5u+Hn\nXf3m9wfqpNqwRzqmK4qyOMdXh8cEgLpii3cB9Sgpq02nTod++ZpG0S9bflMUW8eO7crv1sKp\nxX5M0yj68qvVNmebQce1rqs6K8jdfN+a4qnHuiP81+RsvndDcW1STq01wPlGdPCnaZtKgiJi\nGsGpb2z9dFznhnz1Rq0+3vaNhap5OrRvUfZtyF+0e9f2T998atnbL9+1eMPdp7aKY20A0DCs\nHOx6T39v0/RD3/pyFrsyzlLtzTZt2lTrY4ZKNg4dOjSlzZ152+6rgxIrUVSbafhv+Wjn4lHt\nKj/63V2viYhdVYLGoYXg2o2Z8Vy37Fbd0uujnvo+32iWTXlLRFqe2WH34i3f3f2sjIveionD\n1ehtX69vnljUbQHO1JM3bXq3/JZA7paHrjnzjv9s+Nv5507JW+lRl