AAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["ggplot(data=merged_final_data, aes(x=SedentaryMinutes, y=TotalMinutesAsleep)) +\n","geom_smooth(color= 'purple')+ geom_point(color = 'blue') +\n","labs(title=\"SedentaryMinutes vs. TotalMinutesAsleep\", x = \"SedentaryMinutes\", y = \"TotalMinutesAsleep\")\n"]},{"cell_type":"markdown","id":"71064258","metadata":{"papermill":{"duration":0.033466,"end_time":"2022-11-11T10:07:21.037365","exception":false,"start_time":"2022-11-11T10:07:21.003899","status":"completed"},"tags":[]},"source":["Here we can see the negative relationship between the sedentary minutes and the sleep time. Because of what we found plotting and comparing the very active minutes, the total minutes asleep and the sedentary minutes, it is accurate to say that if you are active during the day, you are going to sleep better."]},{"cell_type":"markdown","id":"9cd535cb","metadata":{"papermill":{"duration":0.033343,"end_time":"2022-11-11T10:07:21.102876","exception":false,"start_time":"2022-11-11T10:07:21.069533","status":"completed"},"tags":[]},"source":["## Recomendations for the business\n","\n","1. Because of all the analysis I did above, I would suggest first the usage of a leaf, which can be worn in multiple ways and can be useful to get more precised data about the user.\n","\n","2. Second, I would recommend to Bellabeat make products who can capture the age, gender, weight and height, as soon as the user wears them. This is going to help get a better and more accurate data that can lead to make a more powerful analysis in the future.\n","\n","3. Third, Bellabeat's users should get a notification with suggestions or reminders when they are not having enough hours of sleep or when they are having excessive hours of sleep.\n","\n","4. The company should promote a notification system to congratulate users when they are been consistent with their activity. Also it will be a great idea to give them a summary of how they are staying active and doing good for their health. This will keep the users motivated.\n","\n","5. Users who are not been active or have stopped burning the calories they need during the day should be notified with the health benefits and advantages of workouts and staying active.\n","\n","6. Users who are been regularly active and using bellabeat's products should get some discount on their newly launched products or some kind of rewards for being a loyal costumer.\n","\n","7. Bellabeat's products should have regular reminders when users have stopped working out, eating or sleeping for less hours or more hours as they should, which can lead to problems in their health.\n","\n","8. Most of the users of the study are Lightly active through out the day, which means they must increase their active minutes in order for a better health."]},{"cell_type":"markdown","id":"75d56063","metadata":{"papermill":{"duration":0.033671,"end_time":"2022-11-11T10:07:21.169137","exception":false,"start_time":"2022-11-11T10:07:21.135466","status":"completed"},"tags":[]},"source":["## Epilogue\n","This is my first data analysis project of Google Data Analytics Pro. It is fascinating to use data to find insights that could lead to business strategy. It is also a humbling experience as I am finishing the google data analytics program."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":14.402308,"end_time":"2022-11-11T10:07:21.323436","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-11T10:07:06.921128","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}